jQuery.fn.etFullWidth = function ( options ) {
    //var settings = $.extend({
    //    type: "default"
    //}, options );
    
    var $this = jQuery(this);
    
    $this.css({
        'left': - (jQuery(window).width() - jQuery('.header > .container').width())/2,
        'width': jQuery(window).width(),
        'visibility': 'visible'
    });
    
    jQuery(window).resize(function(){
	    $this.css({
	        'left': - (jQuery(window).width() - jQuery('.header > .container').width())/2,
	        'width': jQuery(window).width(),
	        'visibility': 'visible'
	    });
    });

    return this;
}